import React from "react";
import { connect } from "react-redux";

const Inicio = ({ personajes }) => {
  return (
    <div>
      <p>lista de animes</p>
    </div>
  );
};

const mapStateToProps = (state) => ({
  personajes: state.personajes,
});

export default connect(mapStateToProps)(Inicio);
